type ListTask = {
    list: string[]
}



export default function TaskList(list: ListTask){



    return (<>

    {list.list.map((nameTask, index) => (
        <li key={index} className="w-full py-5 flex flex-row items-start px-4 laila-semibold bg-white border border-slate-200 rounded-lg">
                    <div className="w-1/2 h-full flex flex-col items-start ga">
                    <span>{nameTask}</span>
                    <img src="https://img.freepik.com/photos-gratuite/portrait-homme-s-amusant_23-2149443790.jpg" className='w-10 h-10 rounded-full object-cover' alt=""   />
                    </div>
                    <div className="w-1/2 h-full flex justify-end ">

                                    <button className="w-max h-max p-2 bg-green-500/70 text-black rounded-2xl text-sm">Assign</button>
                    </div>
        </li>
    ))}
    </>)
}
